import React from 'react';

import './css/desktop.css';

const SiteContent = () => {
  return (
    <div className="settings">
      <div className="container__position d-flex justify-content-center align-items-center">
        <div className="layout-positioner">
          <form className="px-4 py-3">
            <h1 className="hide-header text-center">Настройки по умолчанию</h1>

            <p>Мин. температура помещения, °C:</p>
            <input className="input-group" type="number"/>
            <p>Маск. температура помещения, °C:</p>
            <input type="number"/>
            <p>Влажность воздуха, %:</p>
            <input type="number"/>
            <p>Пульс работника, уд./сек.:</p>
            <input type="number"/>
            <p>Яркость освещения, Вт:</p>
            <input type="number"/>
            <p>Норма углекислого газа, ppm:</p>
            <input type="number"/>
          </form>
        </div>
      </div>
    </div>
  );
};

export default SiteContent;
